	<div class="item-post post-12451 post type-post status-publish format-standard hentry category-news">
		<div class="article-title-wrapper"><h5><a href="https://dubsscdapoli.in/%e0%a4%a6%e0%a4%be%e0%a4%aa%e0%a5%8b%e0%a4%b2%e0%a5%80-%e0%a4%85%e0%a4%b0%e0%a5%8d%e0%a4%ac%e0%a4%a8-%e0%a4%ac%e0%a4%81%e0%a4%95-%e0%a4%b8%e0%a4%bf%e0%a4%a8%e0%a4%bf%e0%a4%af%e0%a4%b0-%e0%a4%b8-30/" class="article-title">दापोली अर्बन बँक सिनियर सायन्स कॉलेजमध्ये विद्यार्थ्यांनी घेतले &#8216;पौगंडावस्था व्यवस्थापन मार्गदर्शन &#8216;</a></h5><div class="article-date"><span class="day">03</span><span class="month">Aug</span><span class="year">2023</span></div><div class="description"><p>दापोली अर्बन बँक सिनियर सायन्स कॉलेजमधील महिला विकास कक्षातर्फे दिनांक २ ऑगस्ट, २०२३ रोजी महाविद्यालयातील विद्यार्थ्यांसाठी &#8216; पौगंडावस्था व्यवस्थापन मार्गदर्शन&#8217; या विषयावर व्याख्यान आयोजित करण्यात आले होते. पौगंडावस्थेतील मुलांना व मुलींना मोठे होताना पडणाऱ्या प्रश्नांवर या प्रसंगी चर्चा करण्यात आली. &#8230;</p></div></div></div>
	<div class="item-post post-12457 post type-post status-publish format-standard hentry category-news">
		<div class="article-title-wrapper"><h5><a href="https://dubsscdapoli.in/%e0%a4%a6%e0%a4%be%e0%a4%aa%e0%a5%8b%e0%a4%b2%e0%a5%80-%e0%a4%85%e0%a4%b0%e0%a5%8d%e0%a4%ac%e0%a4%a8-%e0%a4%ac%e0%a4%81%e0%a4%95-%e0%a4%b8%e0%a4%bf%e0%a4%a8%e0%a4%bf%e0%a4%af%e0%a4%b0-%e0%a4%b8-31/" class="article-title">दापोली अर्बन बँक सिनियर सायन्स कॉलेजमध्ये रंगली न्यायालयातील &#8216;मॉक ट्रायल&#8217;!</a></h5><div class="article-date"><span class="day">02</span><span class="month">Aug</span><span class="year">2023</span></div><div class="description"><p>दापोली शिक्षण संस्था संचालित दापोली अर्बन बँक सिनिअर सायन्स महाविद्यालयातील वाणिज्य विभागातर्फे, न्यायालयात चालवल्या जाणाऱ्या खटल्यांच्या पार्श्वभूमीवर विद्यार्थ्यांनी &#8216;मॉक ट्रायल&#8217; चे प्रात्यक्षिक घडवले. प्राध्यापकांनी नेमून दिलेला खटला लढवताना महाविद्यालयातील B.M.S. (बॅचलर इन मॅनेजमेंट स्टडी) च्या विद्यार्थ्यांनी वकील, वैद्यकीय अधिकारी, साक्षीदार, &#8230;</p></div></div></div>
	<div class="item-post post-12429 post type-post status-publish format-standard hentry category-news">
		<div class="article-title-wrapper"><h5><a href="https://dubsscdapoli.in/%e0%a4%a6%e0%a4%be%e0%a4%aa%e0%a5%8b%e0%a4%b2%e0%a5%80-%e0%a4%85%e0%a4%b0%e0%a5%8d%e0%a4%ac%e0%a4%a8-%e0%a4%ac%e0%a4%81%e0%a4%95-%e0%a4%b8%e0%a4%bf%e0%a4%a8%e0%a4%bf%e0%a4%85%e0%a4%b0-%e0%a4%b8-7/" class="article-title">दापोली अर्बन बँक सिनिअर सायन्स कॉलेजमध्ये &#8216;शेअर मार्केट मधील करिअर&#8217; या विषयावर मार्गदर्शन पर व्याख्यान संपन्न.</a></h5><div class="article-date"><span class="day">25</span><span class="month">Jul</span><span class="year">2023</span></div><div class="description"><p>दापोली शिक्षण संस्था संचालित दापोली अर्बन बँक सिनिअर सायन्स महाविद्यालयाचा कॉमर्स विभाग आणि डायमंड एज्युकेशन संस्था यांच्या संयुक्त विद्यमाने दिनांक 22 जुलै 2023 रोजी कॉमर्स विभागाच्या विद्यार्थ्यांसाठी &#8216;शेअर मार्केट मधील करिअरच्या संधी या विषयावर मार्गदर्शनपर व्याख्यान&#8217; आयोजित करण्यात आले. याप्रसंगी &#8230;</p></div></div></div>
	<div class="item-post post-12409 post type-post status-publish format-standard hentry category-news">
